description:
ARM Software Microcontroller Development Kit MDK-ARM Version 5.00

1.Download original installation from Keil website: http://www.keil.com/demo/eval/arm.htm
2. Install it.
3. Run the it(in Windows Vista/7/8 and later RUN AS ADMIN).
4. Click on &quot;License Managment&quot; from &quot;File&quot; menu and copy &quot;ComputerID&quot; or &quot;CID&quot; code.
5. Run the keygen.exe and select &quot;ARM&quot; from &quot;Target&quot;.
6. Paste copied &quot;CID&quot; from step 4 in &quot;CID&quot; box.
7. Press &quot;Generate&quot; button and copy the generated license code.
8. Paste the license code in &quot;New License ID Code (LIC)&quot; box.
9. Have Fun!

